import React from "react";
import SingUpUser from "../API/SingUpUser.ts";
imp

function FormToSingUp()
{
    const[name, setName]=React.useState("");
    const[email, setEmail]=React.useState("");
    const[pass, setPass]=React.useState("");
    const[status, setStatus]=React.useState("");

    const isValide = () =>{
      if (name.length<2)
        return false;
      if (email.length<2)
        return false;
      if (pass.length<2)
        return false;
      return true;
    }

    const handleSubmit = async (e) => {
      e.preventDefault();
      if(!isValide())
      {
        setStatus("Заполните все поля");
        return null
      }
      if(sessionStorage.accessToken!=null)
        if(sessionStorage.accessToken.length>1)
        {
          setStatus("Вы уже зашли");
          return null
        }

      const response: number = await SingUpUser(name, email, pass);
      
      if(response===400)
        setStatus("Пользователь с таким логином уже есть");
      if(response===401)
        setStatus("Неверный логин или пароль");
      if(response===200)
        window.location.replace("http://localhost:3000");

      return response;

    }


    return (
      <div>
        <Eror text={status}/>
        <form onSubmit={handleSubmit}  className="fon">
          <h3>Регистрация</h3>
          <p>
            <label>Имя </label>
            <input type="text" value={name} onChange={(e) => setName(e.target.value)}></input>
          </p>
          <p>
            <label>Почта </label>
            <input type="text" value={email} onChange={(e) => setEmail(e.target.value)}></input>
          </p>
          <p>
            <label>Пароль </label>
            <input type="password" value={pass} onChange={(e) => setPass(e.target.value)}></input>
          </p>
          <button type="submit">Зарегистрироваться</button>
        </form>
      </div>
    );
  }
    
    export default FormToSingUp;
